import React, { useEffect, useState } from 'react'
import axios from 'axios'
import '../Main/dashboard.css'; 

const Cars = ({ user }) => {
  const [cars, setCars] = useState([])
  useEffect(() => {
    const getCars = async () => {
      if (user && (user.rank === 'Client' || user.rank === 'Admin')) {
        try {
          const response = await axios.get(`http://localhost:5000/dashboard/cars?email=${user.email}`)
          setCars(response.data)
        } catch (error) {
          console.error('Failed to fetch cars', error)
        }
      } else {
        setCars([])
      }
    }

    getCars()
  }, [user])
  return (
    <div className="box">
      <div className="minibox">
        <a href="/dashboard">OVERVIEW</a>
        <a href="/dashboard/appointment">APPOINTMENT</a>
        <a className="selected_box" href="/dashboard/cars">YOUR CARS</a>
        <a href="/dashboard/settings">SETTINGS</a>
      </div>
      <div className="minibox_2">
        {user && (
          user.rank === 'Client' ? (
            <>
            <a href="/dashboard/cars/car">CAR 1</a>
            <a href="/dashboard/cars/car">CAR 2</a>
            <a href="/dashboard/cars/car">CAR 3</a>
            <a href="/dashboard/cars/car">CAR 4</a>
            <a href="/dashboard/cars/car">CAR 5</a>
            </>
            ) :
          user.rank === 'Admin' ? (
          <>
          <a href="/dashboard/admin">ADMIN PANEL</a>
          <a href="/dashboard/tbacars">TB APPROVED CARS</a>
          <a href="/store/admin">STORE PURCHASES</a>
          <a href="/dashboard/mechanic">MECHANIC TASKS</a>
          <a href="/archive">ARCHIVE</a>
          </>
          ) :
          user.rank === 'Mecanic' ? (
            <>
            <a href="/dashboard/mechanic">MECHANIC PANEL</a>
            <a href="/dashboard/tbacars">TB APPROVED CARS</a>
            <a href="/dashboard/in_progress-cars">IN PROGRESS CARS</a>
            <a href="/dashboard/done">DONE CARS</a>
            <a href="/archive">ARCHIVE</a>
            </>
          ) :
          <p>Error</p>
        )}
        </div>
      <div className="bigbox">
        <h1>YOUR CARS</h1>
        {cars.map(car => (
          <p key={car.id}>{car.name}</p>
        ))}
      </div>
    </div>
  )
}

export default Cars
